import React from "react";
import Head_bar from "./dashboard/head_bar";
import Menu_bar from "./dashboard/menu_bar";
import Dashboard from "./dashboard/dashboard";
import Lessons from "./lessons";
import Lesson from "./lesson";
import CreateLesson from "./CreateLesson";
import '../styles/dashboard.css'
import SimpleBar from "simplebar-react";
import 'simplebar/dist/simplebar.min.css';
import CreatedLessons from "./CreatedLessons";
import Profile from "./Profile"
import Userlist from "./Manage/UsersList";

class Main extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            mobile_view: false
        }
        console.log(this.props.User_data)
    }

    selectedPage() {
        switch (window.location.pathname) {
            case '/main/dashboard':
                return <Dashboard/>
            case '/main/lessons':
                return <Lessons/>
            case '/main/lesson':
                return <Lesson/>
            case '/main/createlesson':
                return <CreateLesson/>
            case '/main/createdLesson':
                return <CreatedLessons/>
            case '/main/Profile':
                return <Profile/>
            case '/admin/users':
                return <Userlist/>
        }
    }

    render() {
        return (
            <div className={'D_man_view'}>
                <Head_bar User_data={this.props.User_data}/>
                <div className={'D_work_view'}>
                    <Menu_bar mobileBt={'#Head_bar_mobile_menu_bar_bt'}/>
                    <SimpleBar id={'cos'} forceVisible="y" autoHide={false} style={{width: '99%'}}>
                        {
                            this.selectedPage()
                        }
                    </SimpleBar>
                </div>
            </div>
        )
    }

}

export default Main;
